layout(location = 0) out vec4 pc_fragColor;
uniform float iTime;
uniform vec2 iResolution;
uniform float speed;
uniform float height;
uniform float detail;
uniform float colorShift;

#define MAX_STEPS 64
#define MAX_DIST 50.0
#define SURF_DIST 0.005

// ROTATION
mat2 rot(float a) {
    float s = sin(a);
    float c = cos(a);
    return mat2(c, -s, s, c);
}

// 3D WAVE PRESET
float wave(vec2 p) {
    float t = iTime * speed * 0.5;
    float res = 0.0;
    float amp = height;
    float freq = 0.5 * detail;

    // Octave Loop (FBM)
    for(int i=0; i<4; i++) {
        // Sharp-peaked waves
        float w = sin(p.x * freq + t) * cos(p.y * freq + t * 0.8);
        w = 1.0 - abs(w); // Sharpen peaks
        w = pow(w, 1.5);  // Curve valleys

        res += w * amp;

        // Rotate and scale for next octave
        p *= rot(0.5);
        p *= 2.0;
        amp *= 0.5;
        freq *= 1.1;
    }
    return res;
}

// Map: Infinite Plane deformed by Wave function
float map(vec3 p) {
    float h = wave(p.xz);
    return p.y - h;
}

// High Quality Normal
vec3 getNormal(vec3 p) {
    float d = map(p);
    vec2 e = vec2(0.01, 0.0);
    vec3 n = d - vec3(
        map(p - e.xyy),
        map(p - e.yxy),
        map(p - e.yyx)
    );
    return normalize(n);
}

void main() {
    vec2 uv = (gl_FragCoord.xy * 2.0 - iResolution.xy) / iResolution.y;

    // CAMERA
    vec3 ro = vec3(0.0, 3.0, -5.0); // High vantage point
    vec3 ta = vec3(0.0, 0.0, 1.0);  // Look horizon

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0,1,0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + r * uv.x + u * uv.y);

    // RAYMARCH
    float t = 0.0;
    float d = 0.0;

    for(int i=0; i<MAX_STEPS; i++) {
        vec3 p = ro + rd * t;
        d = map(p);
        if(d < SURF_DIST || t > MAX_DIST) break;
        t += d * 0.5; // Slower steps for better wave detail
    }

    vec3 col = vec3(0.0);

    if(t < MAX_DIST) {
        vec3 p = ro + rd * t;
        vec3 n = getNormal(p);

        // LIGHTING
        vec3 lightPos = vec3(2.0, 5.0, -5.0);
        vec3 l = normalize(lightPos);
        vec3 ref = reflect(-l, n);

        // 1. Base Dark Ocean Color
        vec3 oceanBase = vec3(0.0, 0.05, 0.1); 
        // Hue Shift logic
        oceanBase += vec3(0.1, 0.05, 0.0) * colorShift;

        // 2. Diffuse (Soft moon)
        float diff = max(dot(n, l), 0.0);
        col = oceanBase + vec3(0.0, 0.2, 0.3) * diff * 0.5;

        // 3. Specular (Wet shine)
        float spec = pow(max(dot(reflect(-l, n), -rd), 0.0), 32.0);
        col += vec3(0.6, 0.8, 1.0) * spec * 0.5;

        // 4. Subsurface Scattering (Teal glow in peaks)
        // We approximate this by height (p.y)
        float sss = smoothstep(0.0, height, p.y);
        col += vec3(0.0, 0.6, 0.5) * sss * 0.3;

        // 5. Fresnel (Rim light)
        float fres = pow(clamp(1.0 + dot(rd, n), 0.0, 1.0), 5.0);
        col += vec3(0.5, 0.8, 1.0) * fres * 0.5;
    } 
    else {
        // Sky Gradient
        col = mix(vec3(0.0, 0.02, 0.05), vec3(0.0, 0.1, 0.2), uv.y * 0.5 + 0.5);
    }

    // DISTANCE FOG
    // Blends waves into sky seamlessly
    col = mix(col, vec3(0.0, 0.05, 0.1), 1.0 - exp(-t * 0.05));

    // GAMMA & POST
    col = pow(col, vec3(0.4545));
    col *= 1.1; // Exposure

    pc_fragColor = vec4(col, 1.0);
}
